<!doctype html>
<html>
<head>
    <meta charset="utf-8">
    <title>索引</title>
    <link rel="stylesheet" href="{{staticLoadRelativePath}}/jsdoc_static/markdown/base.css">
    <link id="linkstyle" rel='stylesheet' href='{{staticLoadRelativePath}}/jsdoc_static/markdown/markdown14.css'/>
    <link rel="stylesheet" href="{{staticLoadRelativePath}}/jsdoc_static/prettify.min.css">

</head>
<body onload="prettyPrint()">
<div id="preview-box">
    <h3>文件信息<a href="./index.html"> 返回目录</a></h3>
    <div>
        <table class="table">
            <tbody>
            <tr>
                <td>源文件名：</td>
                <td>{{fileNameObject.fileHasExtname}}</td>
            </tr>
            <tr>
                <td>源文件路径：</td>
                <td>{{sourceProjectPath}}</td>
            </tr>
            <tr>
                <td>生成文件名：</td>
                <td>{{fileNameObject.generateFile}}</td>
            </tr>
            <tr>
                <td>生成文件路径：</td>
                <td>{{generateProjectPath}}</td>
            </tr>
            </tbody>
        </table>
    </div>
</div>

<hr/>
<div class="params" id="readme">
    {% autoescape false %}
    {{content}}
    {% endautoescape %}
</div>
<footer>
    <a class="forkme" href="https://github.com/kahn1990/jsdoc-zero">Fork me on GitHub</a>
</footer>
<script type="application/javascript" src="{{staticLoadRelativePath}}/jsdoc_static/jquery.min.js"></script>
<script type="application/javascript" src="{{staticLoadRelativePath}}/jsdoc_static/prettify.min.js"></script>

<script>
    $(document).ready(function () {
        $("pre").addClass("prettyprint source linenums");
    });
</script>
</body>
</html>
